Dioxus also supports a special type of Element: Text. Text Elements do not accept children, just a string literal denoted by double quotes. rsx! ( "hello world"
) Text Elements can be composed within other Elements: rsx! ( div { h1 { "hello world" } p { "Some body content" } }
) Text can also be formatted with any value that implements Display. We use the same syntax as Rust format strings â€“ which will already be familiar for Python and JavaScript users: let name = "Bob";
rsx! ( "hello {name}" ) Unfortunately, you cannot drop in arbitrary expressions directly into the string literal. In the cases where we need to compute a complex value, we'll want to use format_args! directly. Due to specifics of the rsx! macro (which we'll cover later), our call to format_args must be contained within square braces. rsx!( [format_args!("Hello {}", if enabled { "Jack" } else { "Bob" } )] ) Alternatively, &str can be included directly, though it must also be inside square braces: rsx!( "Hello ", [if enabled { "Jack" } else { "Bob" }] ) This is different from React's way of generating arbitrary markup but fits within idiomatic Rust. Typically, with Dioxus, you'll just want to compute your substrings outside of the rsx! call and leverage the f-string formatting: let name = if enabled { "Jack" } else { "Bob" };
rsx! ( "hello {name}" )

