Rust provides us algebraic datatypes: enums that can contain values. Using the match keyword, we can execute different branches of code given a condition. For instance, we could run a function that returns a Result: fn App(cx: Scope)-> Element { match get_name() { Ok(name) => cx.render(rsx!( "Hello, {name}!" )), Err(err) => cx.render(rsx!( "Sorry, I don't know your name, because an error occurred: {err}" )), }
} We can even match against values: fn App(cx: Scope)-> Element { match get_name() { "jack" => cx.render(rsx!( "Hey Jack, how's Diane?" )), "diane" => cx.render(rsx!( "Hey Diane, how's Jack?" )), name => cx.render(rsx!( "Hello, {name}!" )), }
} Do note: the rsx! macro does not return an Element, but rather a wrapper struct for a Closure (an anonymous function). To turn our rsx! into an Element, we need to call cx.render. To make patterns like these less verbose, the rsx! macro accepts an optional first argument on which it will call render. Our previous component can be shortened with this alternative syntax: fn App(cx: Scope)-> Element { match get_name() { "jack" => rsx!(cx, "Hey Jack, how's Diane?" ), "diane" => rsx!(cx, "Hey Diana, how's Jack?" ), name => rsx!(cx, "Hello, {name}!" ), }
} Alternatively, for match statements, we can just return the builder itself and pass it into a final, single call to cx.render: fn App(cx: Scope)-> Element { let greeting = match get_name() { "jack" => rsx!("Hey Jack, how's Diane?" ), "diane" => rsx!("Hey Diana, how's Jack?" ), name => rsx!("Hello, {name}!" ), }; cx.render(greeting)
}

