In Dioxus, there is a distinction between controlled and uncontrolled inputs. Most inputs you'll use are controlled, meaning we both drive the value of the input and react to the oninput. Controlled components: let value = use_state(&cx, || String::from("hello world")); rsx! { input { oninput: move |evt| value.set(evt.value.clone()), value: "{value}", }
} With uncontrolled inputs, we won't actually drive the value from the component. This has its advantages when we don't want to re-render the component when the user inputs a value. We could either select the element directly - something Dioxus doesn't support across platforms - or we could handle oninput and modify a value without causing an update: let value = use_ref(&cx, || String::from("hello world")); rsx! { input { oninput: move |evt| *value.write_silent() = evt.value.clone(), // no "value" is driven here â€“ the input keeps track of its own value, and you can't change it }
}

