The input of your Component must be passed in a single struct, which must implement the Props trait. We can derive this trait automatically with #[derive(Props)]. Dioxus Props is very similar to @idanarye 's TypedBuilder crate and supports many of the same parameters. There are 2 flavors of Props: owned and borrowed. All Owned Props must implement PartialEq Borrowed props borrow values from the parent Component Owned Props Owned Props are very simple â€“ they don't borrow anything. Example: // Remember: owned props must implement PartialEq!
#[derive(PartialEq, Props)]
struct VoteButtonProps { score: i32
} fn VoteButton(cx: Scope<VoteButtonProps>) -> Element { cx.render(rsx!{ div { div { "+" } div { "{cx.props.score}"} div { "-" } } })
} Now, we can use the VoteButton Component like we would use a regular HTML element: fn main() { dioxus::desktop::launch(App);
} fn App(cx: Scope) -> Element { cx.render(rsx! ( VoteButton { score: 42 } ))
} And we can see that the Component indeed gets rendered: Screenshot of running app. Text: "+ \ 42 \ -" The simplest Owned Props you can have is () - or no value at all. This is what the App Component takes as props. Scope accepts a generic for the Props which defaults to (). // this scope
Scope<()> // is the same as this scope
Scope Borrowed Props Owning props works well if your props are easy to copy around - like a single number. But what if we need to pass a larger data type, like a String from an App Component to a TitleCard subcomponent? A naive solution might be to .clone() the String, creating a copy of it for the subcomponent â€“ but this would be inefficient, especially for larger Strings. Rust allows for something more efficient â€“ borrowing the String as a &str. Instead of creating a copy, this will give us a reference to the original String â€“ this is what Borrowed Props are for! However, if we create a reference a String, Rust will require us to show that the String will not go away while we're using the reference. Otherwise, if we referenced something that doesn't exist, Bad Things could happen. To prevent this, Rust asks us to define a lifetime for the reference: #[derive(Props)]
struct TitleCardProps<'a> { title: &'a str,
} fn TitleCard<'a>(cx: Scope<'a, TitleCardProps<'a>>) -> Element { cx.render(rsx!{ h1 { "{cx.props.title}" } })
} This lifetime 'a tells the compiler that as long as title exists, the String it was created from must also exist. Dioxus will happily accept such a component â€“ we can now render it alongside our VoteButton! fn App(cx: Scope) -> Element { // For the sake of an example, we create the &str here. // But you might as well borrow it from an owned String type. let hello = "Hello Dioxus!"; cx.render(rsx! ( VoteButton { score: 42 }, TitleCard { title: hello } ))
} New screenshot of running app, now including a "Hello Dioxus!" heading.

