You can easily create optional fields by attaching the optional modifier to a field: #[derive(Props, PartialEq)]
struct MyProps { name: String, #[props(optional)] description: Option<String>
} fn Demo(cx: MyProps) -> Element { todo!()
} Then, we can completely omit the description field when calling the component: rsx!{ Demo { name: "Thing".to_string(), // description is omitted }
} The optional modifier is a combination of two separate modifiers: default and strip_option. The full list of modifiers includes: default - automatically add the field using its Default implementation strip_option - automatically wrap values at the call site in Some optional - alias for default and strip_option into - automatically call into on the value at the callsite For more information on how tags work, check out the TypedBuilder crate. However, all attributes for props in Dioxus are flattened (no need for setter syntax) and the optional field is new.

